import React from 'react';

const UserInput = ({ value, onChange }) => (
  <input
    type="text"
    value={value}
    onChange={onChange}
    placeholder="Type your message..."
    style={{
      position: 'absolute',
      bottom: '20px',
      right: '20px',
      width: '200px',
      padding: '10px',
      borderRadius: '20px',
      border: 'none',
      backgroundColor: 'rgba(255, 255, 255, 0.8)',
    }}
  />
);

export default UserInput;
